import React, { useEffect, useState }  from "react";
import { ArtContainer, ArtContent } from "./PageElements";
const Art = () => {

  const [randomArt, setRandomArt] = useState();

  useEffect(() => {
    fetch('https://secret-basin-38348.herokuapp.com/random')
      .then((response) => response.json())
      .then((data) => setRandomArt(data))
      .catch((error) => console.log(error.message));
  }, []);


  return (
    <ArtContainer>
      <ArtContent>
        <h1>Random Piece Generator</h1>
        <img src={randomArt.url}/>
      </ArtContent>
    </ArtContainer>
  );
};

export default Art;
